import React, { useState } from "react";
import CreateUser from "./components/Users/CreateUser";
import UserList from "./components/Users/UserList";

const App = () => {
  const [userList, setUserList] = useState([])

  return <div>
    <CreateUser/>
    <UserList users={usersList}/>
  </div>;
};

export default App;
